import { getString } from "../../locales/languages/string";
import { Flex } from "../../style";
import { GrayButtonPopup } from "../../styles/Buttons";
import { inputDataSpecialPopup } from "../../styles/Constants";
import { PopupWindowBox } from "../../styles/Input";
import { SerifText, ErrorInputText } from "../../styles/TextStyles";
import { setSingleInput } from "../functions/setInputsToForm";

export const PopupConfirm = (props: any, doFunction: any) => {
  console.log(props);

  return (
    <PopupWindowBox>
      <SerifText>{props?.popup.message}</SerifText>
      <Flex>
        <GrayButtonPopup
          onClick={() => props?.setPopup({ isActive: false, type: "Yiked2" })}
        >
          {getString("buttons", "goBack")}
        </GrayButtonPopup>
        <GrayButtonPopup
          // onClick={() => props?.setPopup({ isActive: false, type: "Yiked2" })}
          onClick={() => props?.doFunction("x")}
        >
          {getString("buttons", "yes")}
        </GrayButtonPopup>
      </Flex>
    </PopupWindowBox>
  );
};
